import React, { useContext } from "react";
import { Typography, Button } from "@mui/material";
import { UserContext } from "./StateMan";
import slider1 from "../assests/slider1.jpg";

function SectionA(props) {
  const { modalS, eighttenS, eleventwelveS } = useContext(UserContext);
  const [modal, setModal] = modalS;
  const [eightten, setEightten] = eighttenS;
  const [eleventwelve, setEleventwelve] = eleventwelveS;
  return (
    <div
      style={{
        display: "flex",
        // alignItems: "center",
        // justifyContent: "center",
        marginTop: 50,
        flexWrap: "wrap",
      }}
    >
      <div style={{ width: "50%", marginTop: 40 }}>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            // justifyContent: "center",
            marginLeft: 100,
            flexWrap: "wrap",
          }}
        >
          <div style={{ width: 100 }}>
            <hr />
          </div>
          <div style={{ marginLeft: 10 }}>
            <Typography> CAREER COUNSELLING </Typography>
          </div>
        </div>
        <div style={{ width: 600, marginLeft: 200 }}>
          <Typography
            style={{
              color: " #B3864D",
              fontSize: "76px",
              fontFamily: ["Playfair Display SC", "serif"],
            }}
          >
            LET'S CHANGE HOW AND WHY YOU WORK
          </Typography>
        </div>
        <div style={{ display: "flex", justifyContent: "center" }}>
          <Button
            variant="contained"
            size="large"
            style={{
              backgroundColor: "#fccc14",
              width: 350,
              paddingBlock: 15,
              margin: 10,
              color: "#5b5c5c",
              marginLeft: 0,
            }}
            onClick={() => {
              setEightten(true);
              setModal(true);
            }}
          >
            Book Now For 8th-10th
          </Button>
          <Button
            variant="contained"
            size="large"
            style={{
              width: 350,
              paddingBlock: 15,
              margin: 10,
              color: "#fccc14",
              marginLeft: 0,
            }}
            onClick={() => {
              setEleventwelve(true);
              setModal(true);
            }}
          >
            Book Now For 11th-12th
          </Button>
        </div>
      </div>
      <div
        style={{
          width: "50%",
          display: "flex",
          justifyContent: "center",
          flexWrap: "wrap",
        }}
      >
        <img src={slider1} height="500px" width="600px" alt="" />
      </div>
      <div style={{ display: "none" }}>{(modal, eightten, eleventwelve)}</div>
    </div>
  );
}

export default SectionA;
